import React from 'react'
import "./Component-Map-Top-Button.css"

const Button = (props) => {
    return (
        <div className = "component-map-button">
            <button onClick={props.increaseViewBoxWidth} >+</button>
            <button onClick={props.decreaseViewBoxWidth}>-</button>
        </div>
    )
}

export default Button
